import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src= "./michaelscott.jpg" className="App-logo" alt="logo" />
        <p>
          Leyda Marrero-Morales
        </p>
        <a
          className="App-link"
          href="www.linkedin.com/in/leyda-marrero-032884164"
          target="_blank"
          rel="noopener noreferrer"
        >
          Take a look at my LinkedIn
        </a>
      </header>
    </div>
  );
}

export default App;
